import React from 'react';
import {
  Nav,
  NavLink,
  Bars,
  NavMenu,
  NavBtn,
  NavBtnLink,
} from './NavbarElements';
  
const Navbar = () => {
  return (
    <>
      <Nav>
        <Bars />
  
        <NavMenu>
          <NavLink to='pages/home' activeStyle>
            Home
          </NavLink>
          <NavLink to='pages/cart' activeStyle>
            Cart
          </NavLink>
          <NavLink to='pages/wishlist' activeStyle>
            Wishlist
          </NavLink>
          <NavLink to='pages/account' activeStyle>
            Account
          </NavLink>
          <NavLink to='/login' activeStyle>
            Login
          </NavLink>
          {/* Second Nav */}
          {/* <NavBtnLink to='/sign-in'>Sign In</NavBtnLink> */}
        </NavMenu>
        <NavBtn>
          <NavBtnLink to='pages/create-acc'>Create Account</NavBtnLink>
        </NavBtn>
      </Nav>
    </>
  );
};
  
export default Navbar;
